import React from "react";
import { Input, Button } from "antd";

const { Search } = Input;

export const SeachBar = (props) => {
  return (
    <div>
      <Search
        onChange={props.handleChange}
        onPressEnter={props.handleSubmit}
        onSearch={props.handleSubmit}
        enterButton
        size="middle"
        type="text"
        style={{
          width: 800,
          position: "fixed",
          top: 70,
          display: "flex",
          alignItems: "center",
        }}
      />
    </div>
  );
};
